import React from "react";

function Duedate() {
    return (
        <div className="dd">
        <header className="ddd">

          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
        <h1>Hi friends</h1>
      </div>
    );
}

export default Duedate;
